import MovieCard from "components/MovieCard";
import Pagination from "components/Pagination";

function Listing() {
  return (
    /* fragma não inflencia na estrutura do html */
    <>
      <Pagination />
      <div className="row">
        <div className="col">
          <MovieCard />
        </div>
      </div>
    </>
  );
}

export default Listing;
